import './SignIn.css';
import React,{useState} from "react";
import logo from './img/blue_logo.PNG';
import signInText from './img/signIn.PNG';
import cat1 from './img/SignIn1.png';
import cat2 from './img/SignIn2.PNG';
import cat3 from './img/SignIn3.PNG';
import cat4 from './img/SignIn4.PNG';
import { BrowserRouter as Router,Link } from 'react-router-dom';//BrowserRouter
import { Routes ,Route } from 'react-router-dom';
import HomePage from './homePage.js';

class SignIn extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        student_id: ''
      };
  
      this.handleInputChange = this.handleInputChange.bind(this);
    }
  
    handleInputChange(event) {
      const target = event.target;
      const value = target.type === 'checkbox' ? target.checked : target.value;
      const name = target.name;
  
      this.setState({
        [name]: value
      });
    }
  
    render() {
      return (
        <div className="SignIn">    
            <div className='bg'>
                <div className='signIn'>
                    <div className="title">
                        
                        <div className="title-img">
                            <img src={logo} alt="IUA" />
                        </div>
                        <div className="title-text">
                            <img src={signInText} alt="IUA" />
                        </div>
                    </div>
                    <br/>
                    <form className="submitForm" onSubmit={this.handleSubmit}>
                        <label>å­¸è™Ÿ:</label><br/>
                        <input type="text" name="student_id" 
                        value={this.state.student_id} onChange={this.handleChange} />
                        <br/>
                        <label>å¯†ç¢¼:</label><br/>
                        <input type="password" name="password" />
                        <br/>
                        <br/>
                        <Link to='/homePage'>
                            <button type="submit" className="submitButton" >
                                <span className="button_text">ç™»å…¥</span>
                            </button>
                        </Link>
                    </form>
                    
                </div>
                    <div className="img1">
                        <img src={cat1} alt="IUA" />
                    </div>
                    <div className="img2">
                        <img src={cat2} alt="IUA" />
                    </div>
                    <div className="img3">
                        <img src={cat3} alt="IUA" />
                    </div>
                    <div className="img4">
                        <img src={cat4} alt="IUA" />
                    </div>

            </div>
            
        </div>
      );
    }
  }
  

